import React, {Component} from 'react';
import Particles from 'react-particles-js';
import 'homestyles.css'

function Page(){
	return(
		<div id = 'homepage'>
			<Particles 
              params={{
            		particles: {
            			color: '#FF0000'
            		}
            	}}
              style={{
                width: '100%',
              }}
            />
        </div>
	)
}

export default Page;
